import axios from 'axios';
import React from 'react'
import { useState } from 'react'
import Nav from '../Components/Nav'

export default function DeleteData() {
  const [data, setData] = useState('');
  const [id, setId] = useState('');

  const getmachineData = async () => 
  {
    try {
      axios.post('http://localhost:5010',)
    } catch (error) {
      
    }
  }

  const searchId = (e) => {
    e.preventDefault();
  }

  return (
    <div className='w-full h-auto '>
      <Nav />
      <div className='flex-col flex items-center justify-center w-full h-full p-4'>
        <form onSubmit={getmachineData} method="post" className='flex flex-col items-center justify-center p-4 m-2'>
          <input  type="text" placeholder='input ID to get Data from machine' className='text-black w-80 h-10 border-2 border-black rounded m-4 p-2' />
          <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer' type='submit'>submit</button>
        </form>
        <form onSubmit={searchId} method="post" className='flex flex-col items-center justify-center p-4 m-2'>
          <input type="text" placeholder='input ID to get Data from gainers' className='text-black w-80 h-10 border-2 border-black rounded m-4 p-2' />
          <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer' type='submit'>submit</button>
        </form>
        <form onSubmit={searchId} method="post" className='flex flex-col items-center justify-center p-4 m-2'>
          <input type="text" placeholder='input ID to get Data from assessories' className='text-black w-80 h-10 border-2 border-black rounded m-4 p-2' />
          <button  className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'type='submit'>submit</button>
        </form>
          <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'>Get ID DATA from Gainers</button>
          <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'>Get ID DATA from Assessories</button>
          <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'>Get ID DATA from machines</button>
        <h1 className='p-2 m-3'>name</h1>
        <h1 className='p-2 m-3'>price</h1>
        <h1 className='p-2 m-3'>weight</h1>
        <h1 className='p-2 m-3'>description</h1>
        <img src="" alt="none" className='w-96 h-96'/>

        <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'>Delete ID DATA from machines</button>
        <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'>Delete ID DATA from Gainers</button>
        <button className='p-2 m-4 border-2 border-black w-96 h-15 cursor-pointer'>Delete ID DATA from Assessories</button>

      </div>
    </div>
  )
}
